function Login() {
    return (
        <div> <h1>Login form </h1>
            <div className="field">
                <label>Email</label>
                <input
                    type="text"
                    name="Eamil"
                    placeholder="Email"
                />
                <input
                    type="text"
                    name="username"
                    placeholder="Username"
                />

            </div>


        </div>

    );
}

export default Login;
